    the non-federal account to clarify the expenditures made with transfered funds
    disclosed on line 22, ''transfers for non-federal activity''. We are in the process
    of switching over our bookkeeping system to implement the changes as suggested
    by our analyst. By the October 15 quarterly filing all contributions qualifying
